impl Solution {
    pub fn beautiful_indices(s: String, a: String, b: String, k: i32) -> Vec<i32> {
        let mut beautiful_indices = Vec::new();
        let s_bytes = s.as_bytes();
        let a_bytes = a.as_bytes();
        let b_bytes = b.as_bytes();
        let a_len = a_bytes.len();
        let b_len = b_bytes.len();

        for i in 0..=s_bytes.len().saturating_sub(a_len) {
            if s_bytes[i..i+a_len] == a_bytes[..] {
                for j in 0..=s_bytes.len().saturating_sub(b_len) {
                    if s_bytes[j..j+b_len] == b_bytes[..] && (i as i32 - j as i32).abs() <= k {
                        beautiful_indices.push(i as i32);
                        break;
                    }
                }
            }
        }

        beautiful_indices
    }
}
